Nicotine myths discourage smoking cessation via #SaferNicotine patches, gum, vapes, snus and pouches.

In the USA, 4 out of 5 doctors mistakenly believe nicotine causes cancer, heart and lung disease.

@ProfGlantz has urged @FDATobacco NOT to correct these myths.  Which is odd. https://t.co/sWIpYdFdgz
